create table public.person
( 
 id_person varchar(10) not null,
 name varchar(50) not null,
 apell1 varchar(50) not null,
 apelli2 varchar(50) null,
 dt_birth date not null,
 type_doc varchar(20) not null,
 legal_id varchar(20) not null,
 email varchar(255) null,
 phone varchar(20) null,
 gender varchar(20) not null,
 description varchar(512) null
);

alter table public.person
add constraint person_PK  primary key (id_person);


create table public.employees
(
 id_person varchar(10)  not null,
 dt_hire date not null,
 dt_termination date null default '4000-01-01',
 reason_hire varchar(200) null default 'Sin motivo',
 reason_termination varchar(200) null default 'Sin motivo',
 dt_seniority date not null,
 employee_type varchar(200) not null default 'Empleado',
 job varchar(200) not null,
 department varchar(200) not null,
 company varchar(200) not null,
 salary_gross_annual numeric(12,5) null default 0,
 salary_variable_annual numeric(12,5) null default 0,
 id_currency varchar(10) default 'EUR'
);


alter table public.employees
ADD CONSTRAINT employees_PK  PRIMARY KEY (id_person, dt_hire);

alter table public.employees
ADD   CONSTRAINT employees_person_FK FOREIGN KEY (id_person) REFERENCES person(id_person) ON DELETE CASCADE;


